export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{aEV66kQnlj:{data:{id:1810,attributes:{imdbId:"tt1754648",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTMzNjkxMjQ2Ml5BMl5BanBnXkFtZTcwMDUwMzA3NQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"}],item_lang:{data:{id:2473,attributes:{title:c,plot:"Suffering from the loss of his only child, Stanley has secluded himself to a dark and lonely place. Sullen and without hope, he continues to hide from and neglect those he loves despite their attempts to reach out to him. In what seems to be the final days of their already strained marriage, his wife Lisa is presented with a strange gift; an old oil lamp from a far off land. Along with the lamp comes a mysterious messenger and and a question that causes them to search the depths of their hearts for what's truly important in life... If you could have anything you wanted, what would YOU ask for?",slug:"the-lamp"}}},books:{data:[{id:9206,attributes:{title:c,description:h,thumbnail:i,authors:[a,d],firstBook:true,published:f,publisher:g,subtitle:j}},{id:9207,attributes:{title:c,description:h,thumbnail:i,authors:[a,d],firstBook:e,published:f,publisher:g,subtitle:j}},{id:9208,attributes:{title:"Lamp",description:b,thumbnail:b,authors:[a],firstBook:e,published:"2005-01-01",publisher:b,subtitle:b}},{id:9209,attributes:{title:c,description:"\"In what seems to be the final days of their already strained marriage, Stanley and Lisa Walters are presented with a strange gift--an old oil lamp. Along with the lamp comes a mysterious messenger and a statement that will cause them to search the depths of their hearts to find its truth\"--P. [4] of cover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TChazgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,d],firstBook:e,published:"2011-01-01",publisher:"Destiny Image Pub",subtitle:k}},{id:9210,attributes:{title:k,description:"For every man there is a moment in life when he wants to give up. For Stanley Walters it was when he lost his son in a tragic accident. From that moment on he was trapped in a downward spiral of depression. Then he met a very special man named Charles who brought with him a very special message that he said has been passed down for thousands of years. This simple message changed Stanley's life forever. From Charles he learned what it truly means to succeed in every area of life. You can learn this too as you join Stanley as he relives this very exciting journey from despair to triumph. Contained within this book is his journey and each lesson he learned that brought him one step closer to a life he given up in believing was possible. Will you join him? You can, if you Just Believe.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qh9jLdZH65IC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d,a],firstBook:e,published:f,publisher:g,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940958001}}("Jim Stovall","","The Lamp","Tracy J. Trost",null,"2011-09-20","Destiny Image Publishers","For Stanley, life stopped dead in its tracks the day his young son was accidentally killed. His wife, Lisa, tried to push forward into the future-but her husband didn't even know where to begin. Then Charles Montgomery III appeared out of nowhere and challenged the couple to consider the inconceivable, \"What I am about to tell you will change your life. You can have anything you want, including true happiness, and I am going to tell you the secret of how to get it.\" Will Stanley let go of the past and grab hold of a future full of love and a new destiny? Will Lisa take her friend's advice and leave Stanley for the guy at the fitness club? Or will they continue to be haunted by the pain and guilt of that fateful day when Eddy died? The Lamp brings Stanley and Lisa face to face with past tragedy and future hope-all wrapped in the gift of three wishes that will challenge you to live beyond the hurt and pain, if you just believe.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7fDlpgMr7_0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","A Novel by Jim Stovall with Tracy J Trost","Just Believe"))